(1483365, 94, 'Web', 'Order Tracking', 'here should be complete Flow, as below,There should be order tracking number rather than Order-ID, so change it and both will not be similar.There should be option for seller and admin to put the details so that buyer can see the status like the normal tracking . The buyer will get the tracking number ( courier) via email, and after every update from seller/admin, he will get the alert in his email the tracking status of that order. even after receiving by the buyer, seller/admin will change the status to received , so add there as well. Buyer will get the confirmation alert after receiving the product.general comment on design, spacing and font.', 3, 0, '0000-00-00', 'Where are the options in seller and admin dashboard  to put the status of tracking and other details. I can’t see those options. There should be option for seller and admin to put the details so that buyer can see the status like the normal tracking . The buyer will get the tracking number ( courier)  via email, and after every update from seller/admin, he will get the alert in his email the tracking status of that order. even after receiving by the buyer, seller/admin will change the status to received , so add there as well. Buyer will get the confirmation alert after receiving the product.general comment on design, spacing and font.', '2020-02-01'),
(1483366, 94, 'Web', 'order listing adminside', 'Add seller, Product and QTY details in the listing, Under the action, add edit and delete option, Also for the date, add the feature like calendar from where you can select the date, month , year, Also include the number of listings either add the option more to add more listings in that page etc.', 3, 0, '0000-00-00', 'Product and QTY details still missing in the listing.Under the action, add edit and delete option also missing. Calendar option working only on chrome, but on other browser like safari its not working.', '2020-02-01'),
(1483367, 94, 'Web', 'order detail adminside', 'Add the picture of the product, also tracking detail should be there,vendor, product name and tracking number should be clickable to check the details of that part.. Also print invoice option is not working here.', 3, 0, '0000-00-00', 'tracking detail should be there, vendor, product name and tracking number should be clickable to check the details of that part.. Also print invoice option is not working here.', '2020-02-01'),
(1483368, 94, 'Web', 'order status adminside', 'font and sizing should be standard, as already discussed,', 4, 0, '0000-00-00', NULL, '2020-02-01'),
(1483369, 94, 'Web', 'order status filter adminside', 'Add seller name, Product name /general in the filters to search specifically. Also for the data, add the feature like calendar from where you can select the date, month , year,', 3, 0, '0000-00-00', 'Add seller name, Product name /general  in the filters to search specifically', '2020-02-01'),
(1483370, 94, 'Web', 'order date filter adminside', 'for the data, add the feature like calener from where you can select the date, month , year,', 3, 0, '0000-00-00', 'Calendar option working only on chrome, but on other browser like safari its not working.   Also the font of calender should be same', '2020-02-01'),
(1483371, 94, 'Web', 'Checkout/User address', 'I am getting the fuctionality of checkout, but after ordering one product and going to cart there I am not getting continue shopping options, I am getting the details of product in the view cart, while filling out the customer and shipping details, there are no mandatory fields to fill out to complete , this should be as per standard, Also there are design issues also, like spacing, font, size, how you are using the page, already discussed many times, Also there should be option to edit the address or delete the old address. As buyer having its own profile and dashboard option', 3, 0, '0000-00-00', 'I am getting the fuctionality of checkout, but after ordering one product and going to cart  there I am not getting continue shopping options,  Also there should be option to edit the address or delete the old addres. As buyer having its own profile and dashboard  with all the option, Still there are spacing issues . add mandatory fiields like address, phone number and name as per the standard.', '2020-02-01'),
