d show on one page\r\n\r\n12. Order Management module ---> View Order: Columns for entries should be as follows:\r\n\r\n                        a. Product Name (this will show barcode or product code, as this will be synced with QBO\'s Product Name field)\r\n                        b. Product Description\r\n                        c. SKU (ea, pk, kg, etc.)\r\n                        d. Quantity\r\n                        e. Rate\r\n                         f. Total\r\n                        g. Remove \"Size\"\r\n                        h. Quantity to be Shipped (by default, this should equal the Quantity field in \"d.\" above. However, user should be able to change Quantity in this column\r\n\r\n13. Order Management module ---> View Order: Before Product Name, there should be a check box next to each entry, and by default all check boxes should be checked. However, user should be able to uncheck. \r\n\r\n14. Shift Assign Rider drop-down to bottom, next to Assign Rider box\r\n- Generate URL\'s for all modules\r\n- Remove broken links\r\nWarehouse\r\n - add view processed PO\'s (when stock is added in the warehouse)\r\n- Add PO No.\r\nAccountant app\r\n  - Cash collected from rider\r\n  - maintain balances\r\n  - History of all cash received\r\nAdmin \r\n    - not loading properly\r\non admin side,edit product,product price not editable.\r\non admin side,edit product,product description not editable.\r\non client side,exception on product detail page.\r\nproduct uploaded in quick books,not show on website.\nActivate forget password module.\n\n\n\n', 1, '2018-08-16 13:41:46', '2019-08-23 17:15:30', NULL),
