(46, 28, 'LADB WEB', 'MarketPlace', 'MS Petroleum', 'Other', '#ef9898', '#4c2f1a', '', '2020-08-31', '2018-11-15', 80000, '', '2019-09-30', 60000, 0, NULL, NULL, NULL, 'PKR', 140000, 'Login\r\nSignup\r\nSocial Media Icons\r\nAdd New API\r\nSeller Dashboard\r\nAdmin Dashboard\r\nAdmin Permissions\r\nSet your Pricing (For Sellers) \r\nTransactions Fee Integration by Marketyourapi\r\nCommission charged by Marketyourapi', '*Admin Login.\r\n*User Management with permissions.\r\n*User Management with company permissions.\r\nUser Management with bank permission. \r\n*Item Management with creation/deletion/edit/update/view operation & pdf reporting.\r\n*Customer Management with creation/deletion/edit/update/view operation & pdf reporting.\r\n*Supplier Management with creation/deletion/edit/update/view operation.\r\n*Expense Management with creation/deletion/edit/update/view operation.\r\nBank Management with creation/deletion/edit/update/view operation.\r\nAccount Ledger with date filter pdf reporting.\r\nStock Report with date filter pdf reporting.\r\n*Sale Management with sale return and pdf invoice generation.\r\nSale report by Invoice, Party& Item wise in pdf.\r\n*Purchase Management with sale return and pdf invoice generation.\r\nPurchase report by Invoice, Party& Item wise in pdf.\r\n*Cash Payment Vouchers with creation/deletion/edit/update/view operation & pdf voucher generation.\r\n*Cash Receipt Voucher with creation/deletion/edit/update/view operation & pdf voucher generation.\r\n*Bank Payment Vouchers with creation/deletion/edit/update/view operation & pdf voucher generation.\r\n*Bank Receipt Voucher with creation/deletion/edit/update/view operation & pdf voucher generation.\r\n*Journal Voucher with creation/deletion/edit/update/view operation & pdf reporting.\r\nSale Tax Management with creation/deletion/edit/update/view operation & pdf reporting.\r\nPurchase Tax Management with creation/deletion/edit/update/view operation & pdf reporting.\r\nCurrent Balance Adju