ew\r\n*Detail view of products\r\n*-Supplier name on the top.\r\n*-Show remaining balance\r\n*-invoice No\r\n*-remove \"detail view\"\r\n*-Bank list\r\n*-Add \"Amount\" in the end\r\n*-Sku Auto generate with item name\r\n*-Add \"UOM\"\r\n*-PI No. auto generate\r\n*-give edit in front of invoice\r\n*-\"Amount payable\" or paid\r\n*-Supplier name,balance,payment method,amount paid\r\n*-sent purchase return\r\n*-merge sales,pump purchase and distribution\r\n*-replace invoices with bills\r\n*-first view then edit\r\npump sales\r\n-SI No(sale invoice No)\r\n-No customer\r\n-No \"Account Type\"\r\n-Add \"machine name\"\r\n-remove \"item name\"\r\n-Add \"previous reading\" \"current reading\"\r\n-\"Price\" with \"Rate\"\r\n-Add \"Pump name\"\r\n-Auto Row\r\n-At the end it still show \"total sales\"\r\n-Credit sale\r\nExpense management\r\n-Pump Expense\r\n-Distribution expense\r\nBills Module(pump sale)\r\nPump management\r\n-first open main screen,plus button add on main screen for redirect to create pump.\r\n-Add Dip in tank column,in create pump page.\r\n-Sequence of fields Tank name,Total capital,opening stock,UOm,opening balance,then dip.\r\n-After save,redirect to main screen.\r\n-on main screen,After click pump,open view screen.\r\n-In view sequence Tank name,current stock,Dip,machine name,closing reading.\r\n-in view,plus button redirect to create machine.\r\n-sequence of machine machine name,opening reading,rate.\r\n-pump name not dropdown.\r\nChart of Account\r\n-Asset creation?fixed asset,how to add?(discuss)\r\n-capital add in account type.\r\n-\"Sub account name\" add in create account.\r\nBusiness summary add on dashboard(customer,supplier,cash in hand).\r\nPurchase Management\r\n-Radio button add in create purchase for purchase pump & purchase distribution.\r\n-Inspection(Stock back) functionality.\r\n-CNG\r\n-Material  add multiple sub description and prices.\r\n-CNG Reading base.\r\n-Stock not available.\r\n-Add Sale in CNG\r\n-Add purchase in CNG\r\n-Add 