onts\r\n***- Type: Cash/Credit \r\n*-\r\ndiscuss about the dip chart\r\nin view machines next to current stock add also current dip\r\nin create sale remove the pump sale # from the top and add three things \r\n1) date \r\n2) sales man name\r\n3) Day/Night\r\nAdd Sales management \r\nAdd Purchase Management\r\nin create CNG remove the uom and opening balance\r\nin create dispenser add UOM\r\nin credit sale add company name and vehicle name \r\nmake company name necessary and vehicle name optional\r\ncompany transfer (loan/cash/bank)\r\nRe allocate stock\r\nRemove pump sale from pump management\r\nGeneral ledger\r\nAccount payable summary/Account receivable\r\nReports (see software)\r\nItem ledger\r\nzakat report\r\npnl\r\nbalance sheet\r\npump sale\r\nall list\n\n', 1, '2018-10-19 15:24:51', '2019-10-09 11:37:39', NULL),
