(94, 62, 'LADB WEB', 'Freelancing Platform', 'Houz', 'Commercial Real Estate', '#000000', '#000000', '', '2020-10-12', '2019-04-20', 100000, '', '2019-09-08', 200000, 0, NULL, NULL, NULL, 'PKR', 300000, 'Freelancer Login/Signup \r\nClient Login/Signup\r\nAdmin Permissions \r\nPost a Job\r\nCreate a Milestone\r\nPayment Processing \r\nLivechat\r\nChat System \r\nHire a Freelancer\r\nNotifications \r\nSubmit Proposals \r\nReview Proposals \r\nReview / Rating System \r\nTransaction Reporting \r\nPayouts \r\nCategories Management\r\nSkills Management \r\nDispute Management', 'Realtor marketplace (www.zameen.com)\r\nProfessional Marketplace(www.houzz.com)\r\nSeller Marketplace (www.houzz.com)\r\nComplete E-Commerece marketplace with all the features and options\r\nblogs, forums, and others as per project requirements\r\n\r\nAll the features and options of the above mentioned both websites in addition to the contract document, if anything is missed out.\r\nSeller\r\n\r\n\r\nNew Messages and emails from Seller\r\nTotal number of sellers\r\nNew Sellers Request for Approval (a popup and notification)- add this option in the website/theme options either approval is required or not\r\nNew Product Submission Approval (a popup and notification)\r\nTotal Number of Orders\r\nPending orders for shipments\r\nSeller package numbers and new request for approval (a popup and notification))\r\n▪ Titanium Package (requests and total numbers)\r\n▪ Gold Package (requests and total numbers)\r\n▪ Silver Package (requests and total numbers)\r\n▪ Free Package (requests and total numbers)\r\n\r\nProfessionals\r\n\r\n\r\nTotal number of Professionals\r\n\r\nNew Professional Request for Approval (a popup and notification)- add this option in the website/theme options either approval is required or not\r\nNew Project Submission Approval (a popup and notification)\r\nProfessionals package – total numbers and new request for approval (a popup and notification))\r\n▪ Titanium Package (requests and to