 with respect to their payments and total as well\r\n\r\n\r\n▪ Invoicing report\r\n\r\n\r\nWebsite Management\r\n\r\n\r\n\r\n▪ Refer to theme options and include all the option in accordance to website requirements and basic\r\n\r\n\r\nFunctions\r\n\r\n\r\n▪ User Security/creation (Add other sub-admin users)\r\n\r\n\r\n▪ User roles (Add other sub-admin users)\r\n\r\n\r\n▪ Widgets Add (AT which location and page)\r\n\r\n\r\n▪ Payment reports (from the sellers, professionals, realtors)- (All options, filters, search, view edit, delete, approval)\r\n\r\n\r\n▪ Chat box (Add option) (LIVE chat for customer support) (LIVE chat for titanium Agency)\r\n\r\n\r\n▪ Logout\r\n\r\n\r\nWebsite flow:\r\n\r\n\r\nRealtor/professional/seller sign up ➔there will be facility for free login with basic features ➔otherwise he will select package and sign up ➔request will come to admin ➔email will be generated to user for the package activation request/payment details ➔invoice will be generated automatically and sent to that user email and at the admin panel as well ➔customer will do the payment ➔sent the payment detail and attachment via form on the website ==>will be received at the payment section ➔ admin will approve that payment after verification➔ payment and invoices will be approved➔ then user will be activated for their purchase package ➔ user will be able to login and use the services\r\n\r\n\r\nSame model will be applicable for ads /banner/ featured listings or any other special features.\r\n\r\n\r\nFront end seller dashboard/pages(Refer Houzz)\r\n\r\n\r\n\r\nNote: For seller dashboard, Developer Company will be responsible to include all options and features as per houzz.com with additional options as below\r\n\r\n\r\n1- Sign up page, (integration with Facebook and Google), , use any Background picture and use signup form on the above, and use clickable links in different colour. (Refer-Houzz)\r\n\r\n\r\n2- After Signup, (putting email and password), Next page of different cate