ummary\r\n\r\n\r\n▪ All Blogs\r\n\r\n\r\n▪ Add a blog\r\n\r\n\r\n▪ Blogs Categories\r\n\r\n\r\nPhotos Management\r\n\r\n\r\n\r\n((All options, filters, search, view edit, delete, approval))\r\n\r\n\r\n▪ Summary\r\n\r\n\r\n▪ All photos\r\n\r\n\r\n▪ Photos Categories and sub categories\r\n\r\n\r\nReport Management\r\n\r\n\r\n\r\nWe can generate the following reports\r\n\r\n\r\n▪ Summary\r\n\r\n\r\n▪ Seller information (All Sellers report. Also specific, Like Seller Name, Package Detail, No\r\n\r\n\r\nof Products, No. of Orders, Payment, Contact Detail) ( First Filter than Generate Report.\r\n\r\n\r\n)\r\n\r\n\r\n▪ Seller information (Enter Seller ID and generate report. Like Package Detail, No of\r\n\r\n\r\nProducts, No. of Orders, Payment, Contact Detail)\r\n\r\n\r\n▪ Realtor information (Enter Seller ID and generate report. Like Package Detail, No of\r\n\r\n\r\nProducts, No. of Orders, Payment, Contact Detail)\r\n\r\n\r\n▪ Professional information (Enter Seller ID and generate report. Like Package Detail, No\r\n\r\n\r\nof Products, No. of Orders, Payment, Contact Detail )\r\n\r\n\r\n▪ Product and order reports\r\n\r\n\r\n▪ Payment reports for each/ specific seller and in total as well for a period of time\r\n\r\n\r\n▪ Total packages report with respect to their payments and total as well\r\n\r\n\r\n▪ Invoicing report\r\n\r\n\r\nWebsite Management\r\n\r\n\r\n\r\n▪ Refer to theme options and include all the option in accordance to website requirements and basic\r\n\r\n\r\nFunctions\r\n\r\n\r\n▪ User Security/creation (Add other sub-admin users)\r\n\r\n\r\n▪ User roles (Add other sub-admin users)\r\n\r\n\r\n▪ Widgets Add (AT which location and page)\r\n\r\n\r\n▪ Payment reports (from the sellers, professionals, realtors)- (All options, filters, search, view edit, delete, approval)\r\n\r\n\r\n▪ Chat box (Add option) (LIVE chat for customer support) (LIVE chat for titanium Agency)\r\n\r\n\r\n▪ Logout\r\n\r\n\r\nWebsite flow:\r\n\r\n\r\nRealtor/professional/seller sign up