ssign.\r\n\r\n\r\n7- Create a sketch option as per Houzz.\r\n\r\n\r\nRefer link: https://www.houzz.com/sketch/\r\n\r\n\r\n8- Email features when client send a message or ask any question, and email features with the houzz for the invoicing, packages and other email related features.\r\n\r\n\r\nRealtor frontend dashboard\r\n\r\n\r\n\r\n\r\nSign up page, (integration with Facebook and Google, use any Background picture and use signup form on the above, and use clickable links in different colour.\r\n\r\n2- After Signup, (putting email and password), Next page of different categories appear with the icon, Title and description on the top of the background image.\r\n\r\n\r\n3- Then after selecting Agent or agency separately, they will fill the sign up form\r\n\r\n\r\n1- In the Dashboard section, below option should appear.\r\n\r\n\r\n2- Create Main option (Property Management) as main tab, and on the side bar, show sub options, as below\r\n\r\n\r\nAdd New Property (form should be complete with all the field including, floor plan, payment plan and 360 image)\r\n\r\n\r\nAll property Listings\r\n\r\n\r\n3- Create Main option (New Projects) as main tab, and on the side bar, show sub options, as below\r\n\r\n\r\nManage projects\r\n\r\n\r\nNew Projects (Title, Description, payment Plan, images, house plan, video, 360 feature, contact form)\r\n\r\n\r\n4- Create Main option (Favourite properties) as main tab\r\n\r\n\r\n5- Create Main option (Saved Searches) as main tab\r\n\r\n\r\n6- Create Main option (Charges/Invoices) as main Tab, on the side bar show sub options as below, this method is for subscription basis Subscription Packages, (where they have all the details of their package and the amount they have given to houz),\r\n\r\n\r\nOffline invoices (invoices for offline system) only with the realtor logo\r\n\r\n\r\nInvoices from Houz (the invoices which we (Houz) will send to them.\r\n\r\n\r\n(Include filters for all the options)\r\n\r\n\r\n7- Create Main option (Message box) as main Tab, where all messages will come to them Create Main option (Realtor Management) as main Tab, on the side bar show sub options as below.\r\n\r\n\r\nProfile information\r\nNotifications\r\nClient Management (Not yet included, add just for filter)\r\nAdd Client\r\n\r\n8- Pop-up or message will appear on their screen in the following scenarios,\r\n\r\n\r\nWhen Property listing successful\r\nWhen Customer will send a message\r\nWhen any new project submitted successfully\r\n\r\n9- Dashboard Page Design and link with database and backend. All information should appear properly, and links will appear in different colour, All the main tabs and sidebar should be properly designed, including the profile pic and cover photo, and all information should appear as per\r\n\r\n\r\nHOUZZ.\r\n\r\n\r\n10- All the dashboard options have filters to manage and search everything, also have view, edit, and delete feature.\r\n\r\n\r\n\r\nPages:\r\n\r\n\r\n\r\n\r\nListing Page:\r\n\r\n\r\nhttps://www.zameen.com/Homes/Lahore-1-1.html\r\n\r\n\r\nOn the top, there will be a slider of images\r\n\r\n\r\nThen there is filter to search the properties\r\n\r\n\r\nOn the side bar, there will be ads\r\n\r\n\r\nOn the listings, connect everything to the database /information,\r\n\r\n\r\nListings will appear on the priority wise (super-hot, hot, featured, and normal), tag will be there on the listing and feature on the backend\r\n\r\n\r\n\r\nProperty Detail Page\r\n\r\n\r\nhttps://www.zameen.com/Property/dha_defence_dha_phase_6_1_kanal_brand_new_outclass_italian_bungalow_near_by_dha_office_and_sports_complex-15418270-1448-1.html\r\n\r\n\r\n\r\nFor the property features, Add the icon option at the backend, like, (swimming pool,\r\n\r\n\r\nAdd 360 image to this page add payment plan,\r\n\r\n\r\nFloor plan, 360 image\r\n\r\n\r\nAgent Page\r\n\r\n\r\nhttps://www.zameen.com/agents.html\r\n\r\n\r\nOn the top, there will be filter\r\nBelow the filter show the titanium agencies slider\r\nBelow this show the featured agents\r\nInclude the sidebar ads for agents, two ads in one row.\r\nBelow this show the cities information of those agents (when someone clicks the city, it will to t', 1, '2019-04-18 17:00:22', '2019-08-23 16:45:42', NULL);
